import { useContext } from "react";
import CartData from "../../store/store";
const Receipt = () => {
  const allData = useContext(CartData);
  return (
    <div>
      <ul style={{listStyleType: "none"}}>
        {allData.items.map(item => {
          <li style={{display: "flex", justifyContent: 'space-between', alignItems: "center", padding: "2rem"}}>
            <div>
              <h4>{item.name}</h4><br/>
              <h3>{item.description}</h3>
            </div>
            <div>
              <h6>price:{item.price}</h6>
            </div>
            <div>
              <p>total price: {item.price * item.count}</p>
            </div>
          </li>
        })}
      </ul>
    </div>
  )
}

export default Receipt;
